import { useEffect, useState } from "react"
import Post from "./post"
import axios from "axios"
export default function Drafts() {
    const [posts, setPosts] = useState([])

    const user = localStorage.getItem("username")
    function getPosts() {
        axios({
            method: "GET",
            url: "/api/drafts/"
        }).then((response) => {
            const newposts = response.data
            setPosts(newposts)
            console.log(newposts)
        })
    }
    useEffect(getPosts, [])

    // const x = posts.filter(post => post.publicationDate === null)
    const elements = posts.map(post => <Post pb={post.publicationDate} pk={post.pk} title={post.title} authorpk={post.author} author={user} text={post.text} />)
   

    return (
        <div className="content">
            {elements}
        </div>
    )
}
